import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o as s,c as a,e as n}from"./app-2b248397.js";const c={},o=n(`<h1 id="报错-system-limit-for-number-of-file-watchers-reached" tabindex="-1"><a class="header-anchor" href="#报错-system-limit-for-number-of-file-watchers-reached" aria-hidden="true">#</a> 报错：System limit for number of file watchers reached</h1><p>使用 pm2 启动 npm run dev 的时候遇到以下错误</p><figure><img src="https://chart-1253420647.cos.ap-beijing.myqcloud.com/markdown/image-20230713141226640.png" alt="文件监控超出系统限制报错" tabindex="0" loading="lazy"><figcaption>文件监控超出系统限制报错</figcaption></figure><p>&quot;System limit for number of file watchers reached&quot;报错表示系统已达到文件监视器的数量限制。文件监视器用于监控文件系统中的变化，比如文件的创建、修改和删除等操作。当文件监视器数量达到系统限制时，无法再创建新的文件监视器，从而导致该错误的发生。（启动的 npm run dev 过多）</p><p>解决方法：</p><div class="language-bash line-numbers-mode" data-ext="sh"><pre class="language-bash"><code><span class="token builtin class-name">echo</span> <span class="token assign-left variable">fs.inotify.max_user_watches</span><span class="token operator">=</span><span class="token number">524288</span> <span class="token operator">|</span> <span class="token function">sudo</span> <span class="token function">tee</span> <span class="token parameter variable">-a</span> /etc/sysctl.conf
<span class="token function">sudo</span> <span class="token function">sysctl</span> <span class="token parameter variable">-p</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p>命令解析</p><ul><li><code>echo</code>命令用于输出文本内容。</li><li><code>fs.inotify.max_user_watches=524288</code>是要输出的文本内容，表示将<code>fs.inotify.max_user_watches</code>参数的值设置为524288。</li><li><code>|</code>是管道符号，用于将echo命令的输出结果传递给后面的命令。</li><li><code>sudo</code>用于以管理员权限执行后续的命令。</li><li><code>tee</code>命令用于将输入的数据同时输出到屏幕和文件中。</li><li><code>-a</code>选项表示以追加模式打开文件，如果文件不存在则创建文件。</li><li><code>/etc/sysctl.conf</code>是要追加内容的文件路径。</li><li><code>sudo sysctl -p</code>命令使配置修改生效</li></ul><p><code>sysctl.conf</code>是一个配置文件，用于定义和调整内核参数。通过修改sysctl.conf文件，可以更改系统的各种内核参数，如网络参数、文件系统参数、虚拟内存参数等。</p>`,9),t=[o];function i(l,r){return s(),a("div",null,t)}const f=e(c,[["render",i],["__file","文件监控超出系统限制.html.vue"]]);export{f as default};
